import React from "react";

function Results(props){
    return(
        <div>
            {props.results.map((result) => {
                return(
                    <div class="card" key={result.id}>
                    <div class="card-body">
                      This is some text within a card body.
                    </div>
                  </div>

                )
            })}
        </div>
    )
}

export default Results;
